import React from "react";
import { Link } from "react-router-dom";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-success p-3">
      <a className="navbar-brand" href="/">
        Boomerang Books
      </a>
      <Link to="/">Search</Link>
      <Link to="/saved">Saved Books</Link>

    </nav>
  );
}

export default Nav;
